function swipeMin(){
    new Swiper(".swiper-1",{
        slidesPerView:2,
        spaceBetween:20,
        centeredSlides:!0,
        loop: true,
        autoplay:{
            delay:2500,
            disableOnInteraction:!1
        },
        pagination:{
            el:".swiper-pagination-1",
            clickable:!0
        },
        navigation:{
            nextEl:".swiper-button-next-1",
            prevEl:".swiper-button-prev-1"}
    })
}

